import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  background : black;
  width : 100%;
  height : 70px;
  padding: 20px 10px;
`
const Wrapper = styled.div`
  display :flex;
  background-color: white;
  width: 100%;
  height: 100%;
  justify-content: space-between;
  align-items: center;
`
const Left = styled.div`
  flex:1;
  display: flex;
  align-items: center;
`
const Language = styled.div`
  font-size: 1.2em;
  font-weight: 600;
`
const Searchbar = styled.div`
  display: flex;
  align-items: center;
  border: 1px solid grey;
  height: 30px;
  width: 100%;
`
const Input = styled.input`
  width: 99%;
  border:none;
`
const Center = styled.div`
  flex:1;
  display: flex;
  align-items: center;
`
const Right = styled.div`
  flex:1;
  display: flex;
  align-items: center;
`

export default function Navbar() {
  return (
    <Container>
      <Wrapper>
        <Left>
          <Language>EN</Language>
          <Searchbar>
            <Input />
          </Searchbar>
        </Left>
        <Center>

        </Center>
        <Right>

        </Right>
      </Wrapper>
    </Container>
  )
}
